import React from 'react';

export const Footer = () => (
  <div className="container">
    <div className="row py-3">
      <div className="col-md">
        <a className="nav-link" href="mailto:contact@quanvy.com">Contact Us</a>
      </div>
      <div className="col-md">
        <small>Copyright &copy; 2020 Quanvy, Inc. All rights reserved.</small>
      </div>
    </div>
  </div>
);
